-(void)pan:(UIPanGestureRecognizer*)movement
{
    
    CGPoint thisPosition;
    //NSLog(@"pan");
    if (movement.state==UIGestureRecognizerStateBegan)
    {
        self.brain.state=@"start";
        thisPosition=[movement locationInView:self.writingZone];
    }
    if (movement.state==UIGestureRecognizerStateEnded)
    {
        self.brain.state=@"end";
        
    }
    if (movement.state==UIGestureRecognizerStateChanged)
    {
        self.brain.state=@"ongoing";
    }
    CGPoint thisMove=[movement translationInView:self.writingZone];
    
    //NSLog(@"thisMove.x= %@",[[NSNumber numberWithFloat:thisMove.x]stringValue]);
    [self.brain getXY:thisPosition :thisMove];
    [movement setTranslation:CGPointMake(0.0, 0.0) inView:self.writingZone];
    
}

-(NSNumber*)indexOfMaxInArrayOfNSNumbers:(NSArray*)array
{
    float maxInArray=0;
    int indexOfMax=0;
    for (int i=0; i<[array count]; i++)
    {
        NSNumber*number=[array objectAtIndex:i];
        float value=[number floatValue];
        if (value>maxInArray)
        {
            indexOfMax=i;
            maxInArray=value;
        }
    }
    NSLog(@"indexOfMax = %@",[[NSNumber numberWithInt:indexOfMax ]stringValue]);
    return [NSNumber numberWithInt:indexOfMax+1 ];
    
    
}

-(void)nextCharacter
{
    for (int i=0; i<[[self.brain lastLetter] count]; i++)
    {
        
        
        NSLog(@"weight %@ for index %@",[[[self.brain lastLetter] objectAtIndex:i]stringValue],[[NSNumber numberWithInt:i]stringValue]);
    }
    NSArray*response=[[NSArray alloc]initWithArray:[self.brain networkOutputs:[self.brain lastLetter] :[[self.initiation layers]objectForKey:@"layer1" ] :[[self.initiation layers]objectForKey:@"layer2" ] :[[self.initiation layers]objectForKey:@"outputLayer" ]]];
    for (int i=0; i<[response count]; i++)
    {
        NSLog(@" outlet #%@, : %@",[[NSNumber numberWithInt:i+1]stringValue],[[response objectAtIndex:i]stringValue]);
    }
    NSString*characterTyped=[self.alphabet objectForKey:[self indexOfMaxInArrayOfNSNumbers:response]];
    NSLog(@"typed letter : %@",characterTyped);
    self.letter.text=characterTyped;

}
-(NSNumber*)orderInAlphabet:(NSString*)string
{
    int orderInAlphabet=0;
    NSString*alphabeticOrder=@"ABCDEFGHIJKLMNOPQRSTUVWXYZ ";
    for(int i=0;i<[alphabeticOrder length];i++)
    {
        if ([[[alphabeticOrder substringToIndex:i+1]substringFromIndex:i]isEqualToString:string])
        {
            orderInAlphabet=i+1;
        }
    }
    NSNumber*order=[NSNumber numberWithInt:orderInAlphabet];
    //NSLog(@"order in alphabet : %@",[order stringValue]);
    return order;
}

-(void)logLettersSample
{
    NSString*lettersSampleString=[[NSString alloc]init];
    for (int i=0; i<[self.lettersSample count]; i++)
    {
        
        for (int j=0; j<[[[self.lettersSample objectAtIndex:i]objectAtIndex:1]count]; j++)
        {
            lettersSampleString=[lettersSampleString stringByAppendingString: [[[[self.lettersSample objectAtIndex:i]objectAtIndex:1]objectAtIndex:j]stringValue]];
        }
    }
    NSLog(@"sample : %@",lettersSampleString);
}

-(void)characterToLearn
{
    NSNumber*orderInAlphabet= [self orderInAlphabet:self.letter.text];
    NSMutableArray*thisCharacter=[[NSMutableArray alloc]initWithObjects:orderInAlphabet,[[self.brain lastLetter]copy] ,nil];
    [self.lettersSample addObject:thisCharacter];
    indexInLettersToType++;
    if (indexInLettersToType>[self.lettersToType length])
    {
        self.letter.text=@" ";
        [self logLettersSample];
        //•••••••••••••••••••••••••••••
        //[self.initiation initiate:self.lettersSample];
        //
    }
    else
    {
        NSString*thisLetter=[[self.lettersToType substringToIndex:indexInLettersToType]substringFromIndex:indexInLettersToType-1];
        NSLog(@"thisLetter :%@",thisLetter);
        self.letter.text=thisLetter;
    }
}


-(void)endOfCharacter:(NSNotification*)notification
{
    if ([notification.name isEqualToString:@"endOfCharacter"])
    {
        [self nextCharacter];
    }
    if([notification.name isEqualToString:@"characterToLearn"])
    {
        [self characterToLearn];
    }
    
    NSLog(@"notification");
   }

