+(NSNumber*)nextPoundSignCursorPosition:(NSString*)string :(NSNumber*)currentCursorPosition
{
    NSNumber*nextPooundCursorPosition=[[NSNumber alloc]init];
    int found=1000;
    for (int i=[currentCursorPosition intValue]+1; i<found; i++)
    {
        if ([[[string substringToIndex:i]substringFromIndex:i-1]isEqualToString:@"#"])
        {
            nextPooundCursorPosition=[NSNumber numberWithInt:i];
            found=i;
        }
    }
    
    return nextPooundCursorPosition;
}


+(NSMutableArray*)convertStringToWeightsArray:(NSString*)string :(NSMutableArray*)arrayOfWeights :(NSNumber*)cursorPosition
{
    int endPosition=[[self.class nextPoundSignCursorPosition:string :cursorPosition]intValue];
    int startPosition=[cursorPosition intValue];
    NSString*thisWeight=[[string substringToIndex: endPosition-1]substringFromIndex:startPosition];
    NSNumber*thisWeightNumber=[NSNumber numberWithFloat:[ thisWeight floatValue]];
    
    [arrayOfWeights addObject:thisWeightNumber];
    if (endPosition<[string length]-1)
    {
        arrayOfWeights=[self.class convertStringToWeightsArray:string :arrayOfWeights :[NSNumber numberWithInt:endPosition]];
    }
    
    
    
    return arrayOfWeights;
}



